        .first{

            padding: 10px;

            margin: 17px 80px 10px 80px;

            border-color: rgb(190, 207, 90);
            color: rgb(190, 169, 142);
        }

        .img{

            height: 100px;
            display: block;
            margin: 60px auto;

        }

        .name{
            color: bisque;

            margin-left: auto;
            display: block;
        }

        .image{
            width: 100px;
            height: 100px;
        }

        .imge{

            height: 90px;
